import React from 'react';
import { Link } from 'react-router-dom';

function EmployeeList(props) {
    console.log(props);
    return (
        <ul>
            {props.employees.map(employee => <li>
                <Link to={{
                    pathname: "/detail",
                    state: { employee }
                }}>
                    {employee.name}
                </Link>
            </li>)}
        </ul>
    );
}

export default EmployeeList;
